bool sjis_to_utf16(uint16_t& dest, uint16_t sjis) {
  for( auto&& pair : _direct_check ) {
    if( pair.sjis == sjis ) {
      dest = pair.utf16;
      return true;
    }
  }

  for( auto&& range : _range_check ) {
    if( range.begin <= sjis && sjis <= range.end ) {
      dest = sjis - range.decl;
      return true;
    }
  }

  for( auto&& pattern : pattern_check_list ) {
    if( (sjis >> 8) == pattern.sjis_left ) {
      uint8_t const* baseval_p = pattern.base_list.begin();
      int counter = 0;

      for( auto&& ch : pattern.conv_table ) {
        if( (ch & 0xFF) == (sjis & 0xFF) ) {
          dest = (baseval_p[1] << 8) | (ch >> 8);
          return true;
        }

        if( ++counter > *baseval_p )
          baseval_p += 2;
      }
    }
  }

  if( sjis < 0x80 ) {
    dest = sjis;
    return true;
  }

  return false;
}

int main() {

  uint16_t dest;

  uint16_t aaa[] {
    // こんにちは
    0x82b1, 0x82f1, 0x82c9, 0x82bf, 0x82cd
  };

  for(auto&&ch:aaa){
    uint16_t sjis = ch;

    sjis_to_utf16(dest, sjis);

    printf("%x %x\n", dest, sjis);
  }


}

